import { defineService, implementService } from '@wix/services-definitions';
import { SignalsServiceDefinition, } from '@wix/services-definitions/core-services/signals';
export const TicketDefinitionServiceDefinition = defineService('ticketDefinition');
export const TicketDefinitionService = implementService.withConfig()(TicketDefinitionServiceDefinition, ({ getService, config }) => {
    const signalsService = getService(SignalsServiceDefinition);
    const ticketDefinition = signalsService.signal(config.ticketDefinition);
    return {
        ticketDefinition,
    };
});
